INSERT INTO `curts` (`id`, `titol`, `any`, `director`, `data_naixement`, `email`, `sinopsis_cat`, `sinopsis_cas`, `sinopsis_eng`, `enll`, `concurs_web`) VALUES (1,'Confesiones',2013,'Aina Oset Moncho','01/05/1988','ainaom@hotmail.com','Hi ha qui guarda en silenci actituds intrínseques , i que de tant en tant , empra la confessió com a via d´escapament . ','Hay quién guarda en silencio actitudes intrínsecas, y que de vez en cuando, emplea la confesión como vía de escape.','There who keeps silent intrinsic attitudes, and occasionally employs confession as an escape . ','http://www.mediafire.com/download/d9d8m1o41a51we2/CONFESIONES.mpg',0),(2,'GAPING DEAD',2012,'Cristian Font','26/05/1968','c_fount@hotmail.com',' Un equip de tècnics en electrònica es dirigeix a un centre de telecomunicacions de l´exèrcit situat en un paratge aïllat de muntanya , amb l´encàrrec de reparar una estranya avaria a les antenes . Quan arriben al lloc es troben que ha passat una cosa inesperada . Sortir d´allà no serà fàcil.','Un equipo de técnicos en electrónica se dirige a un centro de telecomunicaciones del ejército situado en un paraje aislado de montaña, con el encargo de reparar una extraña avería en las antenas. Cuando llegan al lugar se encuentran con que ha ocurrido algo inesperado. Salir de allí no será fácil.',' A team of technicians in electronics is directed to a telecommunications center army located in an isolated spot , with a mountain commissioned to repair a fault in strange antennas . When they arrive they find something unexpected happened . Get out will not be easy . ','https://vimeo.com/73600680',1),(3,'Dring of the dead',2013,'Gaël Pouvreau & Mathieu Auvray','06/09/1981 & 15/15/1981','gaelpouvreau@yahoo.fr',' Perseguit per un zombi un home es refugia en una cabina telefònica . Ell tracta de demanar ajuda . ','Perseguido por un zombi un hombre se refugia en una cabina telefónica. Él trata de pedir ayuda.',' Pursued by a zombie a man takes refuge in a phone booth. He tries to help. ','http://vimeo.com/90542494',1),(4,'El Asalto',2014,'Fran Granada','01/10/1986','itsshortime@gmail.com',' Dos discutien sobre la seva vida i el seu futur ... Aliens al malson que trencaria tots els seus sueæos en segons ... ','Ambos discutían sobre su vida y su futuro...Ajenos a la pesadilla que rompería todos sus sueæos en segundos…',' Both argued about his life and future ... Oblivious to the nightmare that would break all sueæos in seconds ... ','http://www.youtube.com/watch?v=j_EdBUkPJXI&list=UUmekrA1JO_t5HKukw2tvC3A',1),(5,'La Sombra',2014,'Fran Granada','01/10/1986','itsshortime@gmail.com',' T´has passat tant de temps sent una ombra , que t´has oblidat de ser persona ... ','Te has pasado tanto tiempo siendo una sombra, que te has olvidado de ser persona…',' You´ve spent so much time being a shadow, you´ve forgotten to be person ... ','http://www.youtube.com/watch?v=x0SnXyipk2M&list=UUmekrA1JO_t5HKukw2tvC3A',1),(6,'¿Me Oyes?',2012,'Fernando G. Pliego','14/07/1972','fgpliego@yahoo.es',' Mònica és una noia normal , com ho és la seva casa, el barri on viu ; tot és normal en la seva vida . Li agrada cantar i ballar , el normal . Però el normal pot deixar de ser-ho en qualsevol moment . ','Mónica es una chica normal, como lo es su casa, el barrio donde vive; todo es normal en su vida. Le gusta cantar y bailar, lo normal. Pero lo normal puede dejar de serlo en cualquier momento.',' Monica is a normal girl , such as your home , the neighborhood where he lives ; everything is normal in your life. He likes to sing and dance , the usual. But usually can stop being at any time. ','https://vimeo.com/50671469',1),(7,'Mito',2013,'Gonzalo López','19/07/1977','sweetwaterpictures@gmail.com',' Una parella va al cinema per veure una vella pel · lícula de vampirs , el noi , un vampir tracta de seguir la noia , quan la seva aparició una cosa que ningú esperava . ','Una pareja acude al cine para ver una vieja película de vampiros, el chico, un vampiro trata de seguir la chica, cuando su aparición algo que nadie esperaba.',' A couple goes to the movies to see an old vampire movie, the boy , a vampire tries to follow the girl , when her appearance something no one expected . ','http://vimeo.com/80822825',0),(8,'Pianists',2014,'Alexander Loewen','22/04/1992','alexander.loewen@gmx.net',' Una renombrada universitat de música . L´enveja i la dura competència dominen les vides dels estudiants . Un dia abans d´una important audició , Sven i Sina decideixen posar fi a l´èxit de Finn. Ferdinand , un company d´estudis , ha de reaccionar ... ','Una renombrada universidad de música. La envidia y la dura competencia dominan las vidas de los estudiantes. Un día antes de una importante audición, Sven y Sina deciden poner fin al éxito de Finn. Ferdinand, un compañero de estudios, tiene que reaccionar...',' A renowned music college . Envy and tough competition dominate the lives of students. One day before an important audition , Sven and Sina decided to end the success of Finn. Ferdinand , a fellow student , has to react ... ','https://vimeo.com/89194245',0),(9,'LA DANZA',2014,'Fran Granada','01/10/1986','bunsopaco@hotmail.com',' Tots els crims que va fer, van ser per veure-la i sentir-la de nou . ','Todos los crímenes que hizo, fueron para poder verla y sentirla de nuevo.',' All the crimes they did, were to view it and feel it again . ','https://www.youtube.com/watch?v=gPYFjwnBZzc',1),(10,'Rubik´s Cube Terror',2012,'Sander Maran','02/09/1990','SANDERMARAN@hotmail.com',' Un autoestopista es troba amb un cub de Rubik malvat . ','Un autostopista se encuentra con un cubo de Rubik malvado.',' A hitchhiker meets a Rubik cube wicked . ','https://vimeo.com/53751309',1),(11,'Santa Innocència',2013,'DaVid Conill','22/05/1971','davidconill@hotmail.com',' El senyor Esteve és un empresari sense escrúpols i desconfiat que és a punt de viure una experiència que li canviés la vida . ','El señor Esteve es un empresario sin escrúpulos y desconfiado que esta a punto de vivir una experiencia que le cambiara la vida.',' Mr. Esteve is an unscrupulous and distrustful that is about to have an experience that will change your life . ','http://youtu.be/cUyMHFUxYWU',0),(12,'KATERINI',2013,'Daniele Rossi y Roberto Plebani','1990','cesareaceti@hotmail.com','Katerini vol ser la revisitació d´una història popular que, de regió a regió i de país a país, troba característiques diferents. Tots els pares han advertit als nens amb la farsa de l´home negre:\" No facis això o allò, o vaig a cridar l´home negre que ve a llevarte.En nostra Llombardia, aquest home negre ha lluït en el paper de la criatura que, pas a pas, recorre a l´escala que el separa de Katerini (petita Caterina, en el dialecte de Bèrgam ), símbol de tots els nens.','Katerini\" quiere ser la revisitaciòn de una historia popular que, de región a región y de país a país, encuentra características diferentes. Todos los padres han advertido a los niños con la farsa del hombre negro: \"No hagas esto o aquello, o voy a llamar al hombre negro que viene a llevarte.En nuestra Lombardía, este hombre negro ha lucido en el papel de la criatura \"que, paso a paso, recurre a la escalera que lo separa de Katerini (pequena Caterina, en el dialecto de Bérgamo), símbolo de todos los niños.','Katerini \"wants to be revisiting a popular story that, from region to region and from country to country, find different features All parents have warned children with the farce of black man.\" Do not do this or that, or I call the black man who comes to our llevarte.En Lombardy, this black man has looked at the role of the creature \", step by step, uses the stairs separating it from Katerini (small Caterina, in the dialect of Bergamo ), symbol of all children.','http://www.youtube.com/watch?v=bK6VzUvHthY',1),(13,'Pesto',2013,'Ignacio Sepúlveda','16/03/1990','i.sepulveda.barrientos@gmail.com','Salsa Pesto : 50 gr de fulles d´alfàbrega 4 cullerades de pinyons 2 grans d´all 1/2 got d´oli d´oliva 115 gr de formatge parmesà . ','Salsa Pesto: 50 gr de hojas de albahaca 4 cucharadas de piñones 2 dientes de ajo 1/2 vaso de aceite de oliva 115 gr de queso parmesano.',' Pesto Sauce : . . 50g basil leaves 4 tablespoons pine nuts 2 cloves garlic 1/ 2 cup olive oil 115 gr parmesan cheese ','https://vimeo.com/65034850',1),(14,'Black night',2013,'Jean Luc Baillet','10/12/1978','arkhamproductions@gmail.com',' arran d´un desafiament estúpid amb els amics, Ethan un jove estudiant de secundària es troba sol en la nit en un dels cementiris de la ciutat a la recerca d´una tomba antiga amb la llum de la seva torxa ... ','A raíz de un desafío estúpido con sus amigos, Ethan un joven estudiante de secundaria se encuentra solo en la noche en uno de los cementerios de la ciudad en busca de una tumba antigua con la luz de su antorcha ... ',' following a stupid challenge your friends Ethan a young high school student is alone at night in one of the city´s cemeteries in search of an ancient tomb with the light of his torch ... ','http://www.dailymotion.com/video/k3XqrYbI0iWRZ34PJs4',0),(15,'The SharpShooter',2014,'Daniele Antonio Battaglia','24/09/1979','rugantino@globalshow.net',' Un nou heroi fosc , salva una noia d´un criminal que vol matar-la. ',' Un nuevo héroe oscuro, salva a una chica de un criminal que quiere matarla.',' a new dark hero saves a girl from a criminal who wants to kill her ','http://www.youtube.com/watch?v=zY6kcEwZOjw',1),(16,'Uróboros.Eterno Retorno',2013,'Iria Cabrera','30/03/1986','yutisala@gmail.com',' Un home en una estada d´aspecte industrial , plena d´engranatges : una maquinària que gira sense parar, símbol d´un sistema cíclic . Està cec , i la seva ceguesa no li permet sortir d´aquest lloc . I fins i tot quan ho aconsegueix , torna invariablement al punt d´inici . Aquesta és la seva condemna . Aquest curtmetratge , carregat de simbolismes , ens parla de les aparences i el seu engany , d´accions repetitives i inevitables , de la il · lusió de la voluntat i de com, més que ser part d´un sistema , som víctimes d´ell, manipulats per poders més enllà del nostre abast .','Un hombre en una estancia de aspecto industrial, llena de engranajes: una maquinaria que gira sin cesar, símbolo de un sistema cíclico. Está ciego, y su ceguera no le permite salir de este lugar. E incluso cuando lo consigue, vuelve invariablemente al punto de inicio. Esa es su condena. Este cortometraje, cargado de simbolismos, nos habla de las apariencias y su engaño, de acciones repetitivas e inevitables, de la ilusión de la voluntad y de cómo, más que ser parte de un sistema, somos víctimas de él, manipulados por poderes más allá de nuestro alcance.',' A man in a room with an industrial look , full of gear . machinery that turns endlessly , symbol of a ring system . Is blind , and blindness will not let you leave this place . And even when successful, invariably returns to the starting point . That´s the sentence. This short film , full of symbolism , speaks of appearances and deception, repetitive and unavoidable actions , illusion of will and how , rather than being part of a system , we are victims of it , manipulated by powers beyond our reach.','https://vimeo.com/74766788',0),(17,'AMV',2013,'Alex Mesa',' ','alex25654@hotmail.com','Encara canviem el final segueix sent dramàtic, és urgent canviar el principi','Aunque cambiemos el final sigue siendo dramatico, urge cambiar el principio','Although the final change is still dramatic, urges change the top','http://festival.movibeta.com/almacenamiento/pages/descarga.php?id=85693&cseguridad=52129305233182995898 79453230094202989721',1),(18,'April and June',2013,'Marc Nadal','1989','marc@marcnadal.com','April planeja la fugida d´un manicomi, però no vol marxar sense June, una pacient adaptada al sistema implantat que no vol deixar aquesta tranquil · litat, April tracta de convèncer-la per buscar la llibertat. Una de les dues formes de vida ha de desaparèixer. ','April planea la fuga de un manicomio, pero no quiere irse sin June, una paciente adaptada al sistema implantado que no quiere dejar esa tranquilidad, April trata de convencerla para buscar la libertad. Una de las dos formas de vida tiene que desaparecer.','April plans to escape from an asylum, but he will not leave without June, one patient adapted to the implanted system that will not let that calm, tries to convince April to search freedom. One of the two ways of life has to go. ','http://festival.movibeta.com/almacenamiento/pages/descarga.php?id=44473&cseguridad=48990822711102623954 76688954854665905049',1),(19,'Calor humano',2013,'Marc Nadal','1989','marc@marcnadal.com',' Pensar en una vida que neix i serà real i una altra que va ser una preocupació inútil. He sentit la felicitat, es que el que busco existeix. ','Pensar en una vida que nace y será real y otra que fue una preocupación inútil. He sentido la felicidad, se que lo que busco existe.',' Thinking about a life that is born and will be real and the other was a pointless concern. I felt happiness, I know what I´m there. ','http://festival.movibeta.com/almacenamiento/pages/descarga.php?id=84347&cseguridad=39630740483131958434 2834681407892618553',1),(20,'El pela ajos',2011,'Irene Hernanz',' ','irene.hernanz@movibeta.com',' Rubén deixa a Ana el dia de Nadal. Sonen alegres nadales mentre ell recull les seves coses i confessa alguns draps bruts. Però encara queda una mica més, un regal de Nadal que l´Anna no pot ni imaginar. ','Rubén deja a Ana el día de Navidad. Suenan alegres villancicos mientras él recoge sus cosas y confiesa algunos trapos sucios. Pero aún queda algo más, un regalo de Navidad que Ana no puede ni imaginar.',' Ruben leaves Ana on Christmas Day. Joyful carols sound as he gathers his things and confesses some dirty laundry. But there is something more, a Christmas gift that Ana can not imagine. ','http://festival.movibeta.com/almacenamiento/pages/descarga.php?id=56776&cseguridad=93042327099580910552 16904336274630572972',1),(21,'La boca del león',2013,'Alfonso Garcia','1974','alfonclub@gmail.com','Una forta depressió abocar al Sr Montalvo a viure obsessionat pel món dels morts. Però aquest macabre joc ha arribat massa lluny i només una última trucada d´auxili podria acabar amb la seva bogeria.','Una fuerte depresión abocó al Sr. Montalvo a vivir obsesionado por el mundo de los muertos. Pero este macabro juego ha llegado demasiado lejos y sólo una última llamada de auxilio podría acabar con su locura.',' A strong depression devoted itself to Mr. Montalvo to live haunted by the world of the dead. But this macabre game has gone too far and only one last call for help could end his madness.','http://festival.movibeta.com/almacenamiento/pages/descarga.php?id=85311&cseguridad=26543258695118385632 84707470370731729182',1);
